import {
    HomeOutlined,
    PieChartOutlined,
    FormOutlined,
    UserOutlined,
    SettingOutlined,
  } from '@ant-design/icons';

const menuList = [
    {
        key:'home',
        title:'首页',
        icon:HomeOutlined
    },
    {
        key:'statistics',
        title:'统计',
        icon:PieChartOutlined
    },
    {
        key:'manages',
        title:'管理',
        icon:PieChartOutlined
    },
    {
        key:'statistics',
        title:'设置',
        icon:PieChartOutlined
    },
]

export default menuList
